import React from "react";

function ReccomendedList() {
  return (
    <div>
      <ul className="Rec-Content">
        <li key={anime.id}>
          <img
            src={anime.attributes.posterImage.small}
            alt={anime.attributes.canonicalTitle}
          />
        </li>
      </ul>
    </div>
  );
}

export default ReccomendedList;
